import React, { useEffect, useState} from 'react'


export const Delivery = () => {
    const [deliveries, setDeliveries] = useState([])
    var raw = "";

    useEffect(() => {
        const fetchData = async() => {
            var myHeaders = new Headers();
            myHeaders.append("accept", "application/json");
            myHeaders.append("x-api-key", "4sqmKzToVkUoTsVfze4X");

            var requestOptions = {
                method: 'GET',
                headers: myHeaders,
                body: raw,
                redirect: 'follow'
            };

            const result = await fetch("https://pasd-webshop-api.onrender.com/api/order/", requestOptions)
            const json = await result.json()    
            setDeliveries(json);
        }
        fetchData()
    }, [])

    return (
        <div className='authors__container'>
        <h2>Deliveries:</h2>
        {deliveries.map(delivery =>
            <div>
            <h3>{delivery.send_date}</h3>
            </div>)}
    </div>
    )
}
